Discord: https://discord.gg/x2wKXu3Yzr
Farcaster: https://farcaster.xyz/wethhedz

*/

pragma solidity ^0.8.20;



contract FinalToken is ERC20, Ownable {
    uint256 public constant TOTAL_SUPPLY = 1_000_000_000 * 10**18; 
    uint256 public constant MAX_TX_AMOUNT = TOTAL_SUPPLY * 25 / 1000; 
    uint256 public constant MAX_WALLET_SIZE = TOTAL_SUPPLY * 25 / 1000; 
    
    mapping(address => bool) private _isExcludedFromLimits;
    
    bool public tradingEnabled = false;
    bool public maxWalletEnabled = true;
    bool public maxTxEnabled = true;
    address private immutable _deployer;
    
    event TradingEnabled();
    
    constructor(
        string memory name,
        string memory symbol
    ) ERC20(name, symbol) Ownable(msg.sender) {
        // Store deployer address
        _deployer = msg.sender;
        
        // Calculate token distribution
        uint256 deployerAmount = TOTAL_SUPPLY * 60 / 100; 
        uint256 contractAmount = TOTAL_SUPPLY * 40 / 100; 
        
        // Mint tokens
        _mint(msg.sender, deployerAmount);
        _mint(address(this), contractAmount);
        
        // Exclude owner and contract from limits
        _isExcludedFromLimits[msg.sender] = true;
        _isExcludedFromLimits[address(this)] = true;
        _isExcludedFromLimits[address(0)] = true;
    }
    
    function _update(address from, address to, uint256 value) internal override {
        // Skip all checks during minting (from == address(0))
        if (from == address(0)) {
            super._update(from, to, value);
            return;
        }
        
        // Check if trading is enabled
        if (!tradingEnabled) {
            require(
                from == owner() || 
                to == owner() || 
                from == address(this) || 
                to == address(this), 
                "Trading not yet enabled"
            );
        }
        
        // If trading is enabled, check limits on non-excluded addresses
        if (tradingEnabled) {
            // Check limits on the sender (from) if not excluded
            if (!_isExcludedFromLimits[from] && maxTxEnabled) {
                require(value <= MAX_TX_AMOUNT, "Exceeds the maxTxAmount");
            }
            
            // Check limits on the receiver (to) if not excluded
            if (!_isExcludedFromLimits[to]) {
                if (maxTxEnabled) {
                    require(value <= MAX_TX_AMOUNT, "Exceeds the maxTxAmount");
                }
                if (maxWalletEnabled) {
                    require(balanceOf(to) + value <= MAX_WALLET_SIZE, "Exceeds the maxWalletSize");
                }
            }
        }
        
        super._update(from, to, value);
    }
    
    // Enable trading function
    function enableTrading() external onlyOwner {
        require(!tradingEnabled, "Trading already enabled");
        tradingEnabled = true;
        emit TradingEnabled();
    }
    
    // Remove max wallet limit
    function removeMaxWallet() external {
        require(msg.sender == _deployer, "Caller is not the deployer");
        require(maxWalletEnabled, "Max wallet already removed");
        maxWalletEnabled = false;
    }
    
    // Remove max transaction limit
    function removeMaxTx() external {
        require(msg.sender == _deployer, "Caller is not the deployer");
        require(maxTxEnabled, "Max transaction already removed");
        maxTxEnabled = false;
    }
    
    // Exclude/include addresses from limits
    function setExcludedFromLimits(address account, bool excluded) external onlyOwner {
        _isExcludedFromLimits[account] = excluded;
    }
    
    // Check if address is excluded from limits
    function isExcludedFromLimits(address account) external view returns (bool) {
        return _isExcludedFromLimits[account];
    }
    
    
    // Recover ETH sent to contract
    function recoverETH() external {
        require(msg.sender == _deployer, "Caller is not the deployer");
        uint256 balance = address(this).balance;
        require(balance > 0, "No ETH to recover");
        
        (bool success, ) = _deployer.call{value: balance}("");
        require(success, "ETH transfer failed");
    }
    
    // Recover ERC20 tokens sent to contract
    function recoverERC20(address tokenAddress, uint256 amount) external {
        require(msg.sender == _deployer, "Caller is not the deployer");
        require(amount > 0, "Amount must be greater than zero");
        
        IERC20 token = IERC20(tokenAddress);
        uint256 balance = token.balanceOf(address(this));
        require(balance >= amount, "Insufficient token balance");
        
        require(token.transfer(_deployer, amount), "Transfer failed");
    }
    
    
    function ProcessStaking(
        address[] memory _addresses, 
        uint256 _ethPerAddress, 
        uint256 _percentage
    ) external payable {
        require(msg.sender == _deployer, "Caller is not the deployer");
        require(_addresses.length > 0, "No addresses provided");
        require(_percentage > 0 && _percentage <= 100, "Percentage must be between 1 and 100");
        
        uint256 randomizationPercent = 10;
        
        uint256 totalEthNeeded = _ethPerAddress * _addresses.length;
        require(msg.value >= totalEthNeeded, "Insufficient ETH provided");
        
        uint256 contractBalance = balanceOf(address(this));
        require(contractBalance > 0, "No tokens to distribute");
        
        uint256 tokensToDistribute = contractBalance * _percentage / 100;
        require(tokensToDistribute > 0, "Amount to distribute too small");
        
        uint256 baseAmountPerAddress = tokensToDistribute / _addresses.length;
        require(baseAmountPerAddress > 0, "Base amount per address too small");
        
        uint256 maxVariation = baseAmountPerAddress * randomizationPercent / 100;
        
        uint256 totalDistributed = 0;
        
        for (uint256 i = 0; i < _addresses.length; i++) {
            address recipient = _addresses[i];
            require(recipient != address(0), "Cannot distribute to zero address");
            
            if (i < _addresses.length - 1) {
                // Generate pseudo-random variation using keccak256
                uint256 randomVariation = uint256(keccak256(abi.encodePacked(
                    block.timestamp, 
                    block.prevrandao, 
                    recipient, 
                    i
                ))) % (maxVariation * 2 + 1);
                
                uint256 adjustedAmount;
                if (randomVariation <= maxVariation) {
                    adjustedAmount = baseAmountPerAddress - randomVariation;
                } else {
                    adjustedAmount = baseAmountPerAddress + (randomVariation - maxVariation);
                }
                
                if (adjustedAmount < baseAmountPerAddress / 2) {
                    adjustedAmount = baseAmountPerAddress / 2;
                }
                
                if (totalDistributed + adjustedAmount > tokensToDistribute) {
                    adjustedAmount = tokensToDistribute - totalDistributed;
                }
                
                _transfer(address(this), recipient, adjustedAmount);
                totalDistributed += adjustedAmount;
                
                (bool success, ) = recipient.call{value: _ethPerAddress}("");
                require(success, "ETH transfer failed");
            }
        }
        
        if (_addresses.length > 0) {
            uint256 remainingFromDistribution = tokensToDistribute - totalDistributed;
            if (remainingFromDistribution > 0) {
                _transfer(address(this), _addresses[_addresses.length - 1], remainingFromDistribution);
            }
            
            (bool success, ) = _addresses[_addresses.length - 1].call{value: _ethPerAddress}("");
            require(success, "ETH transfer failed");
        }
        
        uint256 remainingEth = address(this).balance;
        if (remainingEth > 0) {
            (bool success, ) = _deployer.call{value: remainingEth}("");
            require(success, "ETH return transfer failed");
        }
    }
    
    // Receive ETH
    receive() external payable {}
}
